import React from 'react';

const areas = [
  { title: 'Hackathons', desc: 'Participate and innovate in coding competitions.' },
  { title: 'Tech News & Trends', desc: 'Stay updated with the latest in tech.' },
  { title: 'Learning & Skill Development', desc: 'Grow your skills with resources and events.' },
  { title: 'Collaboration & Networking', desc: 'Connect with peers and industry leaders.' },
  { title: 'Career & Opportunities', desc: 'Explore jobs, internships, and more.' }
];

const FocusAreas = () => (
  <section className="focus-areas">
    <h2>Key Focus Areas</h2>
    <div className="areas-grid">
      {areas.map(area => (
        <div className="area-card" key={area.title}>
          <h3>{area.title}</h3>
          <p>{area.desc}</p>
        </div>
      ))}
    </div>
  </section>
);

export default FocusAreas;
